		PacketBuilder serverAck(unsigned long long hmac_key, unsigned long long des_key) {
			std::cout << "SEND: SERVERACK" << std::endl;

			// SERVER_ACK
			// This packet is an exception

			PacketBuilder pb;
			pb
				.writeHeaderLong(0)
				.writeHeaderLong(-1)
				.writeHeaderLong(-1)
				.writeHeaderShort(1)
				.writeHeaderInt(0x26)
				.writeHeaderShort(0x0D)
				.writeHeaderByte(0x5B)
				.writeHeaderInt(8)
				.writeHeaderLong(hmac_key)
				.writeHeaderInt(8)
				.writeHeaderLong(des_key)
				.writeHeaderInt(1)
				.writeHeaderLong(0)
				.writeHeaderByte(1)
				.writeHeaderByte(2)
				.writeHeaderByte(2);

			return pb;
		}

