		PacketBuilder channelApproveAck(std::string user, std::string remoteip) {

			// actually charlist maybe
			// order by ascending names

			// get data we need

			sql::ResultSet* account;
			account = Database::query("SELECT * FROM accounts WHERE name = '" + user + "';");
			account->next();

			int accid = account->getInt("id");
			
			sql::ResultSet* chr;
			sql::PreparedStatement* pst;
			pst = Database::con->prepareStatement("SELECT * FROM characters WHERE accid = ?;");
			pst->setInt(1, accid);
			chr = pst->executeQuery();
			pst->close();
			delete pst;

			sql::ResultSet* equip;
			sql::PreparedStatement* pste;
			pste = Database::con->prepareStatement("SELECT item.id, item.itemid, invpos, endurance, expiredate FROM item, equip WHERE item.id = equip.itemid AND item.charid = ? ORDER BY invpos;");
			

			PacketBuilder pb;
			pb
				.writeLong(2)
				.writeLong(account->getInt("charslots"))
				.writeInt(1)
				.writeLong(1)
				.writeLong(chr->rowsCount()); // number of characters

			while (chr->next()) {

				pb
					.writeInt(0)
					.writeInt(accid)
					.writeInt(0)
					.writeByte(0)
					.writeInt(chr->getInt("id"))
					.writeInt(0)
					.writeByte(chr->getInt("unittype")) // or is it unitclass?
					.writeElsString(chr->getString("name"))
					.writeElsString(remoteip)
					.writeShort(0x1FC5)
					.writeInt(chr->getInt("ed"))
					.writeByte(chr->getInt("level"))
					.writeInt(Constants::expTable[chr->getInt("level")].second + chr->getInt("exp"))
					.writeInt(0)
					.writeInt(0)
					.writeInt(0x400554C9)
					.writeLong(0)
					.writeByte(1)
					.writeByte(1)
					.writeInt(0)
					.writeByte(0)
					.writeInt(0)
					.writeLong(0)
					.writeLong(0)
					.writeInt(Constants::expTable[chr->getInt("level")].second) // total exp for this level
					.writeInt(Constants::expTable[chr->getInt("level") + 1].second) // total exp for next level
					.writeInt(0)
					.writeInt(chr->getInt("hp"))
					.writeInt(chr->getInt("attack"))
					.writeInt(chr->getInt("mattack"))
					.writeInt(chr->getInt("def"))
					.writeInt(chr->getInt("mdef"))
					.writeLong(0)
					.writeLong(0)
					.writeInt(0)
					.writeInt(chr->getInt("map"))
					.writeInt(0x9000000)
					.writeInt(0)
					.writeLong(0)
					.writeLong(0);
					//.writeInt(0);

				// equipment
				pste->setInt(1, chr->getInt("id"));
				equip = pste->executeQuery();

				pb.writeInt(equip->rowsCount());

				while (equip->next()) {
					//bool isDecorative = ItemDataProvider::isDecorative(equip->getInt("itemid"));
					bool isDecorative = true; // fuck this
					pb
						.writeInt(equip->getInt("invpos"))
						.writeInt(0)
						.writeInt(equip->getInt("id"))
						.writeByte(9)
						.writeShort(equip->getInt("invpos"))
						.writeInt(equip->getInt("itemid"));

					if (isDecorative) {
						pb.writeByte(0);
					}
					else {
						pb.writeByte(1);
					}

					pb	
						.writeInt(0)
						.writeShort(equip->getInt("endurance"))
						.writeInt(0)
						.writeInt(0)
						.writeInt(0);
					
					if (equip->getBoolean(isDecorative)) {
						pb.writeInt(7);
					}
					else {
						pb.writeInt(0);
					}

					if (equip->getString("expiredate") != "0000-00-00 00:00:00") {
						pb.writeElsString(equip->getString("expiredate"));
					}
					else {
						pb.writeInt(0);
					}
					
					pb.writeByte(0);
				}
					
				pb
					.writeLong(0)
					.writeLong(0)
					.writeLong(0)
					.writeLong(0)
					.writeLong(0)
					.writeShort(1)
					.writeByte(1)
					.writeLong(0)
					.writeShort(0)
					.writeInt(0) //-1 -> 0
					.writeLong(0)
					.writeByte(0)
					.writeInt(0)
					.writeElsString(Time::now())
					.writeInt(0)
					.writeByte(0)
					.writeLong(0)
					.writeLong(0)
					.writeInt(0)
					.writeInt(-1)
					.writeElsString(Time::now())
					.writeInt(0)
					.writeByte(0)
					.writeInt(Time::timestamp_now())
					.writeInt(0)
					.writeInt(Time::timestamp_now())
					.writeLong(0)
					.writeLong(0)
					.writeByte(0)
					.writeInt(-1)
					.writeLong(0)
					.writeShort(0)
					.writeByte(0)
					.writeInt(0)
					.writeInt(0); // added

			}

			pb
				.writeElsString(user)
				.finishPacket(0x488);

			return pb;

		}

