		PacketBuilder createCharAck(int id, std::string name, int unitType, int hp, int atk, int matk, int def, int mdef) {

			PacketBuilder pb;
			pb
				.writeLong(0)
				.writeLong(0)
				.writeByte(0)
				.writeInt(id) // character id
				.writeByte(0)
				.writeInt(unitType)
				.writeElsString(name)
				.writeLong(0)
				.writeShort(0)
				.writeByte(1)
				.writeLong(0)
				.writeLong(0)
				.writeLong(0)
				.writeInt(0x143FA)
				.writeLong(0)
				.writeLong(0)
				.writeLong(0)
				.writeShort(0)
				.writeByte(0)
				.writeInt(0x258) // mana?
				.writeInt(0);

			pb
				.writeInt(hp) // HP
				.writeInt(atk) // attack
				.writeInt(matk) // matk
				.writeInt(def) // def
				.writeInt(mdef); // mdef

			int i;
			for (i = 0; i < 12; i++) {
				pb.writeLong(0);
			}
			
			pb
				.writeShort(1)
				.writeByte(1)
				.writeInt(0)
				.writeByte(0)
				.writeInt(0x12C0) // stamina
				.writeByte(0)
				.writeInt(-1);

			for (i = 0; i < 7; i++) {
				pb.writeLong(0);
			}
			
			pb
				.writeShort(0)
				.writeByte(0)
				.writeInt(-1)
				.writeLong(0)
				.writeInt(0)
				.writeShort(0)
				.writeByte(0)
				.writeElsString(Time::now())
				.finishPacket(0x27);

			return pb;

		}

		PacketBuilder terminateConnectionAck() {

			PacketBuilder pb;
			pb.finishPacket(0x241);

			return pb;

		}

